import { Model } from "miragejs";

export const database = {
  models: {
    users: Model,
    courses: Model,
  },

  seeds(server) {
    server.db.loadData({
      users: [
        {
          id: 1,
          name: "Lucas Mendes",
          accountType: "Key Account",
          image:
            "data:image/png;base64,",
        },
        {
          id: 2,
          name: "Lucas Mendes 2",
          accountType: "Key Account",
          image:
            "data:image/png;base64,",
        },
      ],
      courses: [
        {
          id: 1,
          createdBy: 1,
          name: "Curso de Svelte",
          thumb:
            "data:image/png;base64,",
          description:
            "Um curso para introdução ao Svelte com uso de programação funcional utilizando Ramda e Rx.JS",
        },
        {
          id: 2,
          createdBy: 1,
          name: "Curso de React",
          thumb:
            "data:image/png;base64,",
          description:
            "Como criar aplicativos utilizando ReactJS, Hooks e Router",
        },
      ],
    });
  },

  routes() {
    this.namespace = "api/v1/";

    this.get("/users/:id", (schema, req) => {
      const id = req.params.id;
      return this.schema.users.findBy({ id });
    });

    this.get("/users", () => {
      return this.schema.all("users");
    });

    this.get("/courses", (schema, req) => {
      return schema.courses.all();
    });

    this.post("/courses", (schema, req) => {
      const data = JSON.parse(req.requestBody);
      return schema.courses.create(data);
    });

    this.get("/courses/:id", (schema, req) => {
      const id = req.params.id;
      return schema.courses.where({ createdBy: id });
    });
  },
};
